import React from 'react';
import  "./Register.css";
import { FaUser } from "react-icons/fa";
import { MdOutlineMail } from "react-icons/md";
import { FaLock } from "react-icons/fa";
import { RiLockPasswordFill } from "react-icons/ri";
import { FaPhone } from "react-icons/fa6";
import { useFormik } from "formik";
import * as Yup from 'yup';
import { Link } from 'react-router-dom';
import axios from 'axios';

const Register = () => {
  // const navigate = useNavigate();
  const formInput = useFormik({
    initialValues: { uname: "", email: "", pass: "", cpass: "", mobile: "" },
    validationSchema: Yup.object({
      uname: Yup.string()
        .required('its required')
        .min(2, "minimum 2 character is required")
        .max(15, "Limit Crossed")
        .matches(/[a-z]/, "only use lowercase"),
      email: Yup.string()
        .required('its required')
        .email('invalid email'),
      pass: Yup.string()
        .required('its required')
        .min(4, "minimum 4 character is required")
        .max(12, "limit crossed")
        .matches(/[0-9]/, "Atleast one number is required")
        .matches(/[A-Z]/, "Atleast one uppercase is required")
        .matches(/[^\w]/, "Atleast one special character is required"),
      cpass: Yup.string()
        .required('its required')
        .oneOf([Yup.ref('pass'), null], "password not matches"),
      mobile: Yup.string()
        .required('its required')
        .min(10, "minimum 10 character is required")
        .max(10, "minimum 10 character is required")
    }),
    onSubmit: (values,action) => {
      console.log(values);
      // e.preventDefault();
      let formData = new FormData();
        formData.append('name', data.name)
        formData.append('email', data.email)
        formData.append('password', data.password)
        formdata.append('cpass', data.cpass)
        formData.append('mobile',data.mobile)
      // action.resetForm();
      axios({
        method: 'POST',
        url: 'http://127.0.0.1:4000/regRoute/register',
        headers:{
          "Content-Type": "multipart/form-data",
        },
        body:JSON.stringify(values)
    })
    .then(function (res) {
        console.log(res)
        //  navigate('/login');  
    })
    .catch(function (res) {
        console.log(res)
    });         
    }
  });
  return (
    <div className='container'>
      <form onSubmit={formInput.handleSubmit}>
       
          <h1>Register</h1>
          
            <div className='input-box'>
              <input type="text" name="name" placeholder="name" onChange={(e)=>(e.target.value)} value={formInput.values.uname} /><FaUser className='icon'/><br />
              {formInput.errors.uname ? <i style={{ color: "red" }}>{formInput.errors.uname}</i> : null}
            </div>
          
            <div className='input-box'><input type="email" name="email" placeholder='Email' onChange={(e)=>(e.target.value)} value={formInput.values.email} /><MdOutlineMail className='icon'/><br />
              {formInput.errors.email ? <i style={{ color: "red" }}>{formInput.errors.email}</i> : null}</div>
          
            <div className='input-box'><input type="password" name="pass" placeholder="Password" onChange={(e)=>(e.target.value)} value={formInput.values.pass} /><FaLock className='icon'/><br />
              {formInput.errors.pass ? <i style={{ color: "red" }}>{formInput.errors.pass}</i> : null}</div>
          
            {/* <div className='input-box'><input type="password" name="cpass" placeholder='Confirm Password' onChange={(e)=>(e.target.value)} value={formInput.values.cpass} /><RiLockPasswordFill className='icon'/><br />
              {formInput.errors.cpass ? <i style={{ color: "red" }}>{formInput.errors.cpass}</i> : null}</div> */}
          
            <div className='input-box'><input type="text" name="mobile" placeholder='Mobile Number' onChange={(e)=>(e.target.value)} value={formInput.values.mobile} /><FaPhone className='icon'/><br />
              {formInput.errors.mobile ? <i style={{ color: "red" }}>{formInput.errors.mobile}</i> : null}</div>
                
            <button type="submit">Register</button><br />
               <div className='login-link'>
                  <p>Already Have an Account? <Link to="/registration" className='nav-link'>Login</Link></p>
            </div>
            
        </form>
      </div>
      )
}

      export default Register
